'use client'

import { useState, useEffect } from 'react'
import { Card, CardContent, CardDescription, CardHeader, CardTitle } from "./ui/card"
import { Button } from "./ui/button"
import { Input } from "./ui/input"
import { Label } from "./ui/label"
import { Textarea } from "./ui/textarea"

interface Car {
  _id: string;
  name: string;
  model: string;
  description: string;
  pricePerDay: number;
  available: boolean;
}

export default function CarManagement() {
  const [cars, setCars] = useState<Car[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [editingCar, setEditingCar] = useState<Car | null>(null);
  const [newCar, setNewCar] = useState<Partial<Car>>({
    name: '',
    model: '',
    description: '',
    pricePerDay: 0,
    available: true,
  });

  const fetchCars = async () => {
    const token = localStorage.getItem('token');
    if (!token) {
      setError('No authentication token found');
      setLoading(false);
      return;
    }

    try {
      const response = await fetch('http://localhost:5000/api/cars', {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (!response.ok) {
        throw new Error(`Failed to fetch cars: ${response.status}`);
      }

      const data: Car[] = await response.json();
      setCars(data);
    } catch (error) {
      const err = error as Error;
      setError(err.message || "An unknown error occurred.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchCars();
  }, []);

  const handleCreateCar = async () => {
    const token = localStorage.getItem('token');
    if (!token) {
      alert('Please log in first!');
      return;
    }

    try {
      const response = await fetch('http://localhost:5000/api/cars', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newCar),
      });

      if (response.ok) {
        const createdCar = await response.json();
        setCars([...cars, createdCar]);
        setNewCar({ name: '', model: '', description: '', pricePerDay: 0, available: true });
        alert('Car created successfully!');
      } else {
        const data = await response.json();
        alert(data.message || 'Error creating car.');
      }
    } catch (err) {
      console.error('Error:', err);
      alert('An error occurred while creating the car. Please try again.');
    }
  };

  const handleUpdateCar = async () => {
    if (!editingCar) return;

    const token = localStorage.getItem('token');
    if (!token) {
      alert('Please log in first!');
      return;
    }

    try {
      const response = await fetch(`http://localhost:5000/api/cars/${editingCar._id}`, {
        method: 'PUT',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(editingCar),
      });

      if (response.ok) {
        const updatedCar = await response.json();
        setCars(cars.map(car => car._id === updatedCar._id ? updatedCar : car));
        setEditingCar(null);
        alert('Car updated successfully!');
      } else {
        const data = await response.json();
        alert(data.message || 'Error updating car.');
      }
    } catch (err) {
      console.error('Error:', err);
      alert('An error occurred while updating the car. Please try again.');
    }
  };

  const handleDeleteCar = async (carId: string) => {
    const token = localStorage.getItem('token');
    if (!token) {
      alert('Please log in first!');
      return;
    }

    if (!confirm('Are you sure you want to delete this car?')) return;

    try {
      const response = await fetch(`http://localhost:5000/api/cars/${carId}`, {
        method: 'DELETE',
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });

      if (response.ok) {
        setCars(cars.filter(car => car._id !== carId));
        alert('Car deleted successfully!');
      } else {
        const data = await response.json();
        alert(data.message || 'Error deleting car.');
      }
    } catch (err) {
      console.error('Error:', err);
      alert('An error occurred while deleting the car. Please try again.');
    }
  };

  if (loading) return <p>Loading cars...</p>;
  if (error) return <p className="text-red-500">Error: {error}</p>;

  return (
    <Card>
      <CardHeader>
        <CardTitle>Car Management</CardTitle>
        <CardDescription>Add, edit, or delete cars in the system.</CardDescription>
      </CardHeader>
      <CardContent>
        <div className="space-y-4">
          <h3 className="text-lg font-semibold">Add New Car</h3>
          <div className="grid grid-cols-2 gap-4">
            <div>
              <Label htmlFor="name">Name</Label>
              <Input
                id="name"
                value={newCar.name}
                onChange={(e) => setNewCar({ ...newCar, name: e.target.value })}
              />
            </div>
            <div>
              <Label htmlFor="model">Model</Label>
              <Input
                id="model"
                value={newCar.model}
                onChange={(e) => setNewCar({ ...newCar, model: e.target.value })}
              />
            </div>
            <div>
              <Label htmlFor="pricePerDay">Price per Day</Label>
              <Input
                id="pricePerDay"
                type="number"
                value={newCar.pricePerDay}
                onChange={(e) => setNewCar({ ...newCar, pricePerDay: parseFloat(e.target.value) })}
              />
            </div>
            <div>
              <Label htmlFor="available">Available</Label>
              <Input
                id="available"
                type="checkbox"
                checked={newCar.available}
                onChange={(e) => setNewCar({ ...newCar, available: e.target.checked })}
              />
            </div>
          </div>
          <div>
            <Label htmlFor="description">Description</Label>
            <Textarea
              id="description"
              value={newCar.description}
              onChange={(e) => setNewCar({ ...newCar, description: e.target.value })}
            />
          </div>
          <Button onClick={handleCreateCar}>Add Car</Button>
        </div>

        <div className="mt-8">
          <h3 className="text-lg font-semibold mb-4">Existing Cars</h3>
          {cars.map(car => (
            <div key={car._id} className="mb-4 p-4 border rounded">
              {editingCar && editingCar._id === car._id ? (
                <div className="space-y-4">
                  <Input
                    value={editingCar.name}
                    onChange={(e) => setEditingCar({ ...editingCar, name: e.target.value })}
                  />
                  <Input
                    value={editingCar.model}
                    onChange={(e) => setEditingCar({ ...editingCar, model: e.target.value })}
                  />
                  <Input
                    value={editingCar.description}
                    onChange={(e) => setEditingCar({ ...editingCar, description: e.target.value })}
                  />
                  <Input
                    type="number"
                    value={editingCar.pricePerDay}
                    onChange={(e) => setEditingCar({ ...editingCar, pricePerDay: parseFloat(e.target.value) })}
                  />
                  <div>
                    <Label htmlFor={`available-${car._id}`}>Available</Label>
                    <Input
                      id={`available-${car._id}`}
                      type="checkbox"
                      checked={editingCar.available}
                      onChange={(e) => setEditingCar({ ...editingCar, available: e.target.checked })}
                    />
                  </div>
                  <Button onClick={handleUpdateCar}>Save Changes</Button>
                  <Button variant="outline" onClick={() => setEditingCar(null)}>Cancel</Button>
                </div>
              ) : (
                <>
                  <h4 className="text-lg font-semibold">{car.name} {car.model}</h4>
                  <p>{car.description}</p>
                  <p>Price per day: ${car.pricePerDay}</p>
                  <p>Available: {car.available ? 'Yes' : 'No'}</p>
                  <div className="mt-2">
                    <Button onClick={() => setEditingCar(car)}>Edit</Button>
                    <Button variant="destructive" onClick={() => handleDeleteCar(car._id)} className="ml-2">Delete</Button>
                  </div>
                </>
              )}
            </div>
          ))}
        </div>
      </CardContent>
    </Card>
  );
}
